create table divisions (
    department varchar(100),
    company_division varchar(100),
    primary key (department)
  );



create table company_regions (
   region_id int,
   company_regions varchar(20),
   country varchar(20),
   primary key (region_id)
  );


CREATE TABLE IF NOT EXISTS staff (
    `id` INT,
    `last_name` VARCHAR(10) CHARACTER SET utf8,
    `email` VARCHAR(34) CHARACTER SET utf8,
    `gender` VARCHAR(6) CHARACTER SET utf8,
    `department` VARCHAR(11) CHARACTER SET utf8,
    `start_date` DATETIME,
    `salary` INT,
    `job_title` VARCHAR(36) CHARACTER SET utf8,
    `region_id` INT
);
